import React from 'react'
import { CharacterDataContext } from './RecipeView'
import { useContext } from "react";

export const RecipeCard = () => {
    const x = [starWarsData] = useContext(CharacterDataContext);
    return (
        <div>
            <h1>RecipeCard</h1>
            <h1>Name: {x?.data?.name}</h1>
            <h1>Gender: {x?.data?.gender}</h1>
            <h1>Birth year: {x?.data?.birth_year}</h1>
        </div>
    )
}
